import React from 'react'
import { Card,Box } from '@mui/material';
import styled from '@emotion/styled';

const CardTwo = () => {

const DashBoardCard=styled(Card)`
height:100px;
width: 1176px;
margin:20px 55px;
border: 1px solid #0000001F;
border-radius:16px;
box-shadow:none;
display:flex;
`;
const EnrolledCard=styled(Card)`
width:391.33px
`;

const UsersIconBox=styled(Box)`
height:52px;
width:52px;
background-colorl:#03A9F4;
`;
const QuestionsCard=styled(Card)`
width:391.33px
`;
const AverageCard=styled(Card)`
width:391.33px
`;
  return (
   <>
     <DashBoardCard >
        <EnrolledCard>
            <UsersIconBox>
            </UsersIconBox>
        </EnrolledCard>
        <QuestionsCard></QuestionsCard>
        <AverageCard></AverageCard>
     </DashBoardCard>
   </>
  )
}

export default CardTwo
